import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import 'tachyons';
import {roborts} from './roborts';
// import reportWebVitals from './reportWebVitals';

ReactDOM.render(
  <div>

    <Card id={roborts[0].id} name={roborts[0].name} email={roborts[0].email}/>
    <Card id={roborts[1].id} name={roborts[1].name} email={roborts[1].email} />
    <Card id={roborts[2].id} name={roborts[2].name} email={roborts[2].email} />
  </div>




  ,document.getElementById('root'));



